import ItemListContainer from './components/ItemListContainer.js';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <NavBar />
        <ItemListContainer greeting='Hola, soy Ramiro Trabanco y estoy aprendiendo React.js'/>
      </header>
    </div>
  );
}

export default App;
